import React from "react";
import { Route, Navigate, Routes } from "react-router-dom";

const ProtectedRoute = () => {
  const auth = JSON.parse(localStorage.getItem("auth")) || null;
  if (auth.usuario._id) {
    return <Navigate to="/" />;
  } else {
    return <Navigate to="/login" />;
  }
};
export default ProtectedRoute;
